import React from 'react';
import classes from './Description.module.css';



function Description(props) {

  return (
    <div>
      <h1>Details:</h1>

      <h2>Watch this exercise video</h2>
      <video key={props.exercise.id} width="320" height="325" controls autoPlay align="left">
        <source src={props.exercise.video.url}  type="video/mp4" />
      </video>
      <div className={classes['col-right']}>
      <h1>{props.exercise.name}</h1>
      <h2>{props.exercise.description}</h2>
      </div>
      </div>
  )
}

export default Description
